One day at a time, is a TV show which I discovered in 2018, the same time when i discovered I have depression. This show has helped me so much, given me strength during the hardest days and nights. It's surprising how a show/movie can touch you and inspire you in so many different and unexpected ways. This show also talks about mental health in a very different light which is much needed, specially in india where it is still a taboo. This is one my of favourite scenes from the show where Elena comes out to her grandmother who is well reserved in her cuban heritage, and accepts her sexual identity. 
More power to this show💙
